        </div>
        <div class="row mb-5">
            <div class="col-12 col-md-3 d-flex nandtitle">
                <span class="number__slide">2</span>
                <span class="title ms-3">Внешнее продвижение</span>
            </div>
            <div class="col-12 col-md-9">
              Создаётся полновесная ссылочная масса, а сайт наполняется информативным и полезным контентом, который помогает поисковому продвижению.
            </div>            
        </div>
        <div class="row mb-5">
            <div class="col-12 col-md-3 d-flex nandtitle">
                <span class="number__slide">3</span>
                <span class="title ms-3">Рост записей в клинику</span>
            </div>
            <div class="col-12 col-md-9">
              Увеличивается количество «первичек», а параллельная работа SEO и контекстной рекламы приумножает их количество.
            </div>            
        </div>
		<div class="row mb-5">
            <div class="col-12 col-md-3 d-flex nandtitle">
                <span class="number__slide">4</span>
                <span class="title ms-3">Постоянный рост трафика</span>
            </div>
            <div class="col-12 col-md-9">
              В зависимости от уровня конкуренции, через 2–3 месяца после начала оптимизации переходы по поисковым запросам стабильно растут.
            </div>            
        </div>
		<div class="row mb-5">
            <div class="col-12 col-md-3 d-flex nandtitle">
                <span class="number__slide">5</span>
                <span class="title ms-3">Повышение лояльности</span>
            </div>
