              Как продвигать медицинские услуги?
            </div>
            <div class="qa-content">
            Привычные методы продвижения, например, контекстная реклама, в медицинской сфере не так актуальны, как в других — модерация может не пропустить ваше объявление. Оптимальный вариант — SEO-продвижение. Заинтересованные пользователи регулярно приходят на сайт по ключевым запросам. Кроме SEO, обратите внимание на наружную рекламу, промоакции, рекламу на радио или телевидении и продвижение через контент-маркетинг.
            </div>
        </div>
		<div class="row qa-elem">
            <div class="qa-title">
                Что нужно сделать перед продвижением сайта?
            </div>
            <div class="qa-content">
             Подготовка к продвижению состоит из 5 этапов: 
<ul>
	<li>всесторонний SEO-аудит, который покажет сильные и слабые стороны оптимизации;</li>
<li>проработка семантического ядра и сбор ключевых фраз для охвата всех тематических запросов;</li>
<li>написание экспертного медицинского контента на основе достоверных источников;</li>
<li>анализ поведенческих факторов, который поможет улучшить юзабилити сайта;</li>
<li>отслеживание ключевых показателей и корректировка отдельных метрик. </li>
				</ul>
            </div>
        </div>
		<div class="row qa-elem">
            <div class="qa-title">
            Что входит в SEO-продвижение сайта? 
            </div>
            <div class="qa-content">
            Работа начинается с SEO-аудита сайта, во время которого составляется дальнейший план. Затем прорабатывается семантическое ядро и собираются ключевые фразы, которые используются в оптимизации для поисковых систем. После этого прорабатываются поведенческие и коммерческие факторы и разрабатывается стратегия дальнейшего продвижения сайта на внешних площадках. Первые результаты планомерной работы будут заметны уже через 4 месяца работы.
            </div>
        </div>
        <div class="row qa-elem">
            <div class="qa-title">
               Сколько стоит SEO-продвижение?
            </div>
            <div class="qa-content">
              Цена зависит от многих факторов: состояние медицинского сайта, список работ, которые предстоит сделать. Интернет-агентства предлагают разные сценарии, которые повлияют на итоговую стоимость. Оценивают по показателям роста целевого трафика и лидов, по позиции в ТОПе по ключевым фразам или по всем факторам ранжирования.
            </div>
        </div>
        
