        if(!e.target.classList.contains('qa-elem')){
            e.target = jQuery(e.target).closest('.qa-elem'); 
        }
        jQuery(e.target).toggleClass("active");
        jQuery(e.target).find(".qa-content").slideToggle('slow');
    });
</script>

